import srcNav from '../data/Nav-data.js'

window.addEventListener('resize', function salut() {
    const ListeBigNav = srcNav.map((element) => 
        <span key={element.name.toString()}>
            {element.UserElement ? <img src={element.src}/> : <a href={element.link}><img src={element.src}/></a>}
        </span>
    )

    if (this.window.innerWidth <= 835){
        return (
            <div className="content-nav">
                <div className="nav">{ListeBigNav}</div>
            </div>
        )
    }
})

export default salut
